import React, { useState } from 'react';
import { Box, Typography, Grid, TextField, MenuItem, Chip, IconButton } from '@mui/material';
import { styled } from '@mui/system';
import FilterListIcon from '@mui/icons-material/FilterList';

// Import the images
import s1s from '../assets/s1.jpg';
import s2s from '../assets/s2.jpg';
import s3s from '../assets/s3.jpg';
import s4s from '../assets/s4.jpg';
import s5s from '../assets/s5.jpg';
import s6s from '../assets/s6.jpg';
import s7s from '../assets/s7.jpg';
import s8s from '../assets/s8.jpg';
import s9s from '../assets/s9.jpg';

// Updated data with Baa M Boo branding
const mensClothingItems = [
  { name: 'Mesh Elite Shirt', brand: 'Baa M Boo', price: '$100.00', discountedPrice: '$69.89', image: s1s, colors: 47, type: 'shirt' },
  { name: 'Oxford Premium Shirt', brand: 'Baa M Boo', price: '$126.00', discountedPrice: '$99.89', image: s2s, colors: null, type: 'shirt' },
  { name: 'Textured Luxe Sweater', brand: 'Baa M Boo', price: '$125.00', image: s3s, colors: 5, type: 'sweater' },
  { name: 'Mesh Elite Shirt', brand: 'Baa M Boo', price: '$100.00', discountedPrice: '$69.89', image: s4s, colors: 47, type: 'shirt' },
  { name: 'Oxford Premium Shirt', brand: 'Baa M Boo', price: '$126.00', discountedPrice: '$99.89', image: s5s, colors: null, type: 'shirt' },
  { name: 'Textured Luxe Sweater', brand: 'Baa M Boo', price: '$125.00', image: s6s, colors: 5, type: 'sweater' },
  { name: 'Mesh Elite Shirt', brand: 'Baa M Boo', price: '$100.00', discountedPrice: '$69.89', image: s7s, colors: 47, type: 'shirt' },
  { name: 'Oxford Premium Shirt', brand: 'Baa M Boo', price: '$126.00', discountedPrice: '$99.89', image: s8s, colors: null, type: 'shirt' },
  { name: 'Textured Luxe Sweater', brand: 'Baa M Boo', price: '$125.00', image: s9s, colors: 5, type: 'sweater' },
];

// Styled components
const ItemImage = styled('img')({
  width: '100%',
  height: '450px',
  objectFit: 'cover',
  borderRadius: '12px',
  boxShadow: '0 4px 12px rgba(0,0,0,0.1)',
  transition: 'all 0.3s ease-in-out',
  '&:hover': { transform: 'scale(1.02)', boxShadow: '0 6px 18px rgba(0,0,0,0.15)' },
});

const FilterBox = styled(Box)({
  background: 'linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%)',
  padding: '20px',
  borderRadius: '12px',
  marginBottom: '30px',
  boxShadow: '0 2px 8px rgba(0,0,0,0.05)',
});

const PremiumTypography = styled(Typography)({
  fontFamily: "'Montserrat', sans-serif",
  fontWeight: 700,
  letterSpacing: '0.5px',
});

const MensPage = () => {
  const [filterType, setFilterType] = useState('all');
  const [priceRange, setPriceRange] = useState('all');
  const [searchTerm, setSearchTerm] = useState('');

  const filteredItems = mensClothingItems.filter(item => {
    const matchesType = filterType === 'all' || item.type === filterType;
    const matchesPrice = priceRange === 'all' || 
      (priceRange === 'under100' && parseFloat(item.price.slice(1)) < 100) ||
      (priceRange === '100to150' && parseFloat(item.price.slice(1)) >= 100 && parseFloat(item.price.slice(1)) <= 150);
    const matchesSearch = item.name.toLowerCase().includes(searchTerm.toLowerCase());
    return matchesType && matchesPrice && matchesSearch;
  }).slice(0, 4);

  return (
    <Box sx={{ padding: '40px', maxWidth: '1600px', margin: '0 auto', background: '#fafafa' }}>
      <PremiumTypography variant="h3" sx={{ mb: 4, color: '#1a1a1a' }}>
        Baa M Boo Men's Collection
      </PremiumTypography>

      {/* Smart Filtering */}
      <FilterBox>
        <Box sx={{ display: 'flex', gap: 2, alignItems: 'center' }}>
          <IconButton><FilterListIcon /></IconButton>
          <TextField
            select
            label="Category"
            value={filterType}
            onChange={(e) => setFilterType(e.target.value)}
            sx={{ minWidth: 150 }}
            size="small"
          >
            <MenuItem value="all">All Items</MenuItem>
            <MenuItem value="shirt">Shirts</MenuItem>
            <MenuItem value="sweater">Sweaters</MenuItem>
          </TextField>
          <TextField
            select
            label="Price Range"
            value={priceRange}
            onChange={(e) => setPriceRange(e.target.value)}
            sx={{ minWidth: 150 }}
            size="small"
          >
            <MenuItem value="all">All Prices</MenuItem>
            <MenuItem value="under100">Under $100</MenuItem>
            <MenuItem value="100to150">$100 - $150</MenuItem>
          </TextField>
          <TextField
            label="Search"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            size="small"
            placeholder="Search items..."
            sx={{ flexGrow: 1 }}
          />
        </Box>
      </FilterBox>

      {/* Items Grid */}
      <Grid container spacing={4}>
        {filteredItems.map((item, index) => (
          <Grid item xs={12} sm={6} md={3} key={index}>
            <Box sx={{ textAlign: 'center' }}>
              <ItemImage src={item.image} alt={item.name} />
              <PremiumTypography variant="subtitle1" sx={{ mt: 2, color: '#333' }}>
                {item.name}
              </PremiumTypography>
              <Typography variant="body2" sx={{ color: '#666' }}>
                {item.brand}
              </Typography>
              <Box sx={{ display: 'flex', justifyContent: 'center', gap: 2, mt: 1 }}>
                <Typography variant="body2" sx={{ textDecoration: item.discountedPrice ? 'line-through' : 'none', color: '#999' }}>
                  {item.price}
                </Typography>
                {item.discountedPrice && (
                  <Typography variant="body2" sx={{ color: '#d32f2f', fontWeight: 'bold' }}>
                    {item.discountedPrice}
                  </Typography>
                )}
              </Box>
              {item.colors && (
                <Chip label={`${item.colors} colors`} size="small" sx={{ mt: 1, bgcolor: '#e0f2f1' }} />
              )}
            </Box>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default MensPage;
